import React, { useState } from "react";
import "./App.css";
import ChatWindow from "./components/ChatWindow";

function App() {

  const img = document.createElement('img');
  img.src = 'images/partSelectLogo.png';
  img.alt = "Part Select 25 Year Annversary Logo"

  return (
    <div className="App">
      <div className="heading">
        img
        Instalily Case Study
      </div>
        <ChatWindow/>
    </div>
  );
}

export default App;
